<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <title>TYC Fitment Processor</title>
  <style>
    /* Global Styles */
    body {
      background-color: #B0B0B0;
      font-family: 'Century Gothic', Arial, sans-serif;
      margin: 0;
      padding: 20px;
      color: #333;
    }
    .container {
      max-width: 1000px;
      margin: 0 auto;
      background-color: #fff;
      padding: 30px;
      border-radius: 10px;
      box-shadow: 0 4px 8px rgba(0,0,0,0.1);
      text-align: center;
    }
    /* Header & Logo */
    .header-container {
      text-align: center;
      margin-bottom: 30px;
    }
    .company-logo {
      width: 300px;  /* Adjust as needed */
      height: auto;
      display: block;
      margin: 0 auto 20px auto;
      filter: drop-shadow(2px 2px 4px rgba(0,0,0,0.3));
    }
    .main-header {
      font-family: "Arial Black", sans-serif;
      font-size: 2.75em;
      color: #ffbb00; /* Fill color */
      -webkit-text-stroke: 1.5px #404040; /* Outline color */
      letter-spacing: 0.05em;
      text-shadow: 2px 2px 4px rgba(0,0,0,0.2);
      margin-top: 20px;
    }
    /* Watermark */
    .watermark {
      position: fixed;
      bottom: 10px;
      left: 10px;
      font-family: 'Century Gothic', sans-serif;
      font-style: italic;
      font-size: 13px;
      color: #805E00;
      opacity: 0.8;
      transform: skewX(-10deg);
      z-index: 1000;
    }
    /* Textarea */
    textarea {
      width: 97.5%;
      height: 200px;
      padding: 15px;
      border: 2px solid #ccc;
      border-radius: 5px;
      font-size: 1em;
      margin-bottom: 20px;
      resize: vertical;
    }
    /* Buttons */
    button {
      background-color: #de9b14;
      color: #fff;
      border: none;
      padding: 10px 20px;
      font-size: 16px;
      border-radius: 5px;
      cursor: pointer;
      margin-right: 10px;
      margin-bottom: 20px;
      transition: background-color 0.3s ease;
    }
    button:disabled {
      background-color: #ccc;
      cursor: not-allowed;
    }
    button:hover {
      background-color: #c88c0d;
    }
    /* Table Styles */
    table {
      width: 100%;
      border-collapse: collapse;
      margin-top: 20px;
    }
    th, td {
      border: 1px solid #ccc;
      padding: 12px 15px;
      text-align: left;
    }
    th {
      background-color: #de9b14;
      color: #fff;
    }
    tr:nth-child(even) {
      background-color: #f2f2f2;
    }
  </style>
</head>

    function extractMakeAndModel(line) {
      const [make, model] = line.split('\t').map(part => part.trim());
      return [make, model];
    }

    function extractEngineDetails(lines) {
      const engineDetails = [];
      for (let line of lines) {
        const engineMatch = line.match(/^(\d+(\.\d+)?L)/);
        if (engineMatch) {
          engineDetails.push(engineMatch[1]);
        } else {
          referenceList.Engine.forEach(keyword => {
            if (line.toLowerCase().includes(keyword.toLowerCase())) {
              engineDetails.push(keyword);
            }
          });
        }
      }
      return engineDetails.join('|');
    }

    function extractTrimDetails(lines) {
      for (let line of lines) {
        if (referenceList.Trim.some(keyword => line.trim().toLowerCase() === keyword.toLowerCase())) {
          return line;
        }
      }
      return "";
    }

    function categorizeLine(line) {
      if (referenceList.Body.some(keyword => line.toLowerCase().includes(keyword.toLowerCase()))) {
        return { category: "Body", content: line };
      }
      if (referenceList["Drive Type"].some(keyword => line.toLowerCase().includes(keyword.toLowerCase()))) {
        return { category: "Drive Type", content: line };
      }
      return null;
    }

    function processFitments(input) {
      const entries = input.trim().split(/\n(?=\w+\t\w+)/);
      const results = [];
      for (let entry of entries) {
        const lines = entry.split('\n').map(line => line.trim());
        const [make, model] = extractMakeAndModel(lines.shift());
        const details = {
          yearMakeModel: null,
          trim: extractTrimDetails(lines),
          engine: extractEngineDetails(lines),
          body: "",
          driveType: ""
        };
        let yearRange = null;
        for (let line of lines) {
          if (line.toLowerCase().startsWith("position:")) continue;
          if (/^\d{4}(-\d{4})?(, \d{4}(-\d{4})?)*$/.test(line)) {
            yearRange = line.split(', ').map(range => range.trim());
          } else {
            const categoryLine = categorizeLine(line);
            if (categoryLine) {
              const category = categoryLine.category.toLowerCase();
              if (!details[category]) details[category] = categoryLine.content;
            }
          }
        }
        if (yearRange) {
          yearRange.forEach(range => {
            results.push({
              ...details,
              yearMakeModel: `${range} ${make} ${model}`
            });
          });
        } else {
          results.push(details);
        }
      }
      return results;
    }

    // Global variables to store current results and sort directions
    window.currentResults = [];
    window.sortDirections = {};

    function generateTable(data) {
      const columns = [
        {header: "Year Make Model", key: "yearMakeModel"},
        {header: "Trim", key: "trim"},
        {header: "Engine", key: "engine"},
        {header: "Body", key: "body"},
        {header: "Drive Type", key: "driveType"}
      ];
      
      const table = document.createElement('table');
      const thead = table.createTHead();
      const headerRow = thead.insertRow();
      
      columns.forEach(col => {
        const th = document.createElement('th');
        th.textContent = col.header;
        th.style.cursor = "pointer";
        th.addEventListener("click", function() {
          // Toggle sort order for the column; default to ascending on first click
          window.sortDirections[col.key] = !window.sortDirections[col.key];
          // Sort the global currentResults array based on the clicked column
          window.currentResults.sort((a, b) => {
            let valA = a[col.key] ? a[col.key].toString().toUpperCase() : "";
            let valB = b[col.key] ? b[col.key].toString().toUpperCase() : "";
            if (valA < valB) {
              return window.sortDirections[col.key] ? -1 : 1;
            }
            if (valA > valB) {
              return window.sortDirections[col.key] ? 1 : -1;
            }
            return 0;
          });
          // Re-render the table with sorted data
          const newTable = generateTable(window.currentResults);
          document.getElementById("resultTable").innerHTML = "";
          document.getElementById("resultTable").appendChild(newTable);
        });
        headerRow.appendChild(th);
      });
      
      const tbody = table.createTBody();
      data.forEach(row => {
        const tr = tbody.insertRow();
        columns.forEach(col => {
          const td = tr.insertCell();
          td.textContent = row[col.key] || "";
        });
      });
      return table;
    }

    function copyToClipboard(text) {
      navigator.clipboard.writeText(text).then(() => {
        alert('Results copied to clipboard!');
      }).catch(err => {
        alert('Failed to copy: ' + err);
      });
    }

    document.getElementById('processButton').addEventListener('click', () => {
      const inputText = document.getElementById('inputArea').value.trim();
      const results = processFitments(inputText);
      window.currentResults = results;
      const resultTable = document.getElementById('resultTable');
      resultTable.innerHTML = "";
      resultTable.appendChild(generateTable(results));
      const resultText = results.map(row =>
        `${row.yearMakeModel}\t${row.trim}\t${row.engine}\t${row.body}\t${row.driveType}`
      ).join('\n');
      const copyButton = document.getElementById('copyButton');
      copyButton.disabled = false;
      copyButton.onclick = () => copyToClipboard(resultText);
    });
  </script>
